To determine the measure of \(\angle ADC\), we start by calculating the areas of the two circles and the area of the overlapping region. The area of the smaller circle with radius 1 is:

\[
\text{Area of smaller circle} = \pi \times 1^2 = \pi
\]

The area of the larger circle with radius 2 is:

\[
\text{Area of larger circle} = \pi \times 2^2 = 4\pi
\]

The total area of both circles combined is:

\[
\text{Total area} = \pi + 4\pi = 5\pi
\]

According to the problem, the area of the overlapping region is \(\frac{5}{12}\) of the area of the larger circle:

\[
\text{Area of overlapping region} = \frac{5}{12} \times 4\pi = \frac{20\pi}{12} = \frac{5\pi}{3}
\]

Next, we use the formula for the area of the overlapping region of two circles. The area of the overlapping region of two circles with radii \(r_1\) and \(r_2\) and central angle \(\theta\) (in radians) is given by:

\[
\text{Area of overlapping region} = \frac{1}{2} r_1^2 (\theta - \sin \theta) + \frac{1}{2} r_2^2 (\theta - \sin \theta)
\]

Substituting the given values \(r_1 = 1\) and \(r_2 = 2\), we get:

\[
\frac{5\pi}{3} = \frac{1}{2} \cdot 1^2 (\theta - \sin \theta) + \frac{1}{2} \cdot 2^2 (\theta - \sin \theta)
\]

Simplifying the right-hand side, we have:

\[
\frac{5\pi}{3} = \frac{1}{2} (\theta - \sin \theta) + 2 (\theta - \sin \theta) = \frac{1}{2} (\theta - \sin \theta) + \frac{4}{2} (\theta - \sin \theta) = \frac{5}{2} (\theta - \sin \theta)
\]

To isolate \(\theta - \sin \theta\), we multiply both sides by \(\frac{2}{5}\):

\[
\theta - \sin \theta = \frac{5\pi}{3} \cdot \frac{2}{5} = \frac{2\pi}{3}
\]

We now need to find the value of \(\theta\) that satisfies the equation \(\theta - \sin \theta = \frac{2\pi}{3}\). By inspection or using numerical methods, we find that \(\theta = \frac{2\pi}{3}\) is a solution because:

\[
\sin \left(\frac{2\pi}{3}\right) = \sin \left(\pi - \frac{\pi}{3}\right) = \sin \left(\frac{\pi}{3}\right) = \frac{\sqrt{3}}{2}
\]

So,

\[
\frac{2\pi}{3} - \frac{\sqrt{3}}{2} = \frac{4\pi}{6} - \frac{3\sqrt{3}}{6} = \frac{4\pi - 3\sqrt{3}}{6}
\]

